INSERT INTO creature_text (CreatureID, GroupID, ID, Text, Type, Language, Probability, Emote, Duration, Sound, BroadcastTextId, comment) VALUES (136536, 0, 0, 'Oh my, I appear to be in a bit over my head. Hmmm. Think think.', 14, 0, 100, 53, 0, 0, 159644, 'Longpaws');
INSERT INTO creature_text (CreatureID, GroupID, ID, Text, Type, Language, Probability, Emote, Duration, Sound, BroadcastTextId, comment) VALUES (136536, 1, 0, 'Oh thank you, friend. I could not tell you how many times that has happened to me. Some day I will learn! Ha ha, but not today it seems. Here, I will share what little I have.', 12, 0, 100, 1, 0, 0, 159643, 'Longpaws');
